def count_ways_to_sum(N: int, coins: tuple) -> int:
    """"""
    cs0 = coins
    r = 0
    for i in range(min(cs0[3], N // 10) + 1):
        for j in range(min(cs0[2], (N - i * 10) // 5) + 1):
            cs = list(cs0)
            N1 = N - 10 * i - 5 * j
            if 2 * cs[1] + cs[0] < N1 or (N1 % 2 == 1 and cs[0] == 0):
                continue
            if N1 % 2 == 1:
                N1 -= 1
                cs[0] -= 1
            if cs[0] % 2 == 1:
                cs[0] -= 1
            min2 = max(N1 - cs[0], 0) // 2
            max2 = min(N1 // 2, cs[1])
            r += max2 - min2 + 1
    return r
